INSERT INTO `noticias` VALUES ('1','aviso','<div style=\"text-align: center;\"><p></p><hr id=\"ht\"><p></p><p><font color=\"#ff0000\"><b>******</b></font><b><font color=\"#0000ff\">Ya se encuentran liberadas las actividades de los clubes deportivos y culturales; así como aquellos que&nbsp;realizaron&nbsp;una actividad diferente y que entregaron en tiempo y forma los oficios correspondientes para su acreditación. Por lo cual ya podrán imprimir o guardar desde su hogar la boleta de liberación.</font></b></p><p><b><font color=\"#0000ff\">Solo deben entrar en la&nbsp;sección&nbsp;de \"MI INFO\" &nbsp;en el menú principal de la pagina, poner su usuario (número de control) y contraseña (sino la tienen deberán generar una, y guardarla para consultas posteriores).</font></b></p><p><b><font color=\"#0000ff\">Al iniciar&nbsp;sesión, en la parte debajo de sus datos&nbsp;académicos&nbsp;aparecerán los periodos&nbsp;que han cursado, con la leyenda de acreditado o no acreditado, según sea el caso; de estar acreditado a la izquierda del periodo (en este caso febrero 2012-julio 2012) aparecerá un signo \"+\", que le abre un submenú y un botón \"<u>liberación</u>\" el cual les abre el archivo de su &nbsp;boleta, la &nbsp;que ya podrán imprimir o guardar.</font></b><b><font color=\"#ff0000\">******</font></b></p><p><br></p></div><div style=\"text-align: center;\"><hr id=\"ht\"><p></p><p></p><p></p><p></p><p><!-------------------></p></div>																																							','','2012-02-22','',1),('4f91bce598c98','Prenacional  Deportivo 2012 ','<div style=\"color: rgb(102, 0, 0); font-family: Calibri; background-color: rgb(255, 255, 255); text-align: center; \"><b style=\"color: rgb(255, 0, 0); \">Prenacional Deportivo 2012, del 23 al 27 en Morelia, Michoacán.</b></div><div style=\"color: rgb(102, 0, 0); font-family: Calibri; background-color: rgb(255, 255, 255); text-align: center; \">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<font color=\"#0000ff\"><b>Básquetbol, Fútbol varonil y femenil</b></font></div><div style=\"color: rgb(102, 0, 0); font-family: Calibri; background-color: rgb(255, 255, 255); text-align: center; \"><font color=\"#0000ff\"><b><br></b></font></div><div style=\"color: rgb(102, 0, 0); font-family: Calibri; background-color: rgb(255, 255, 255); text-align: center; \"><b><font color=\"#ff0000\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Del 08 al 11 de Mayo, Morelia, Michocán.</font></b></div><div style=\"color: rgb(102, 0, 0); font-family: Calibri; background-color: rgb(255, 255, 255); text-align: center; \">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<font color=\"#0000ff\"><b>Béisbol, Voleibol varonil y femenil así como voleibol de playa</b></font></div>','tm201204201345416879.jpg','2012-04-20','13:45:41',1),('4f978eedc00e9','Resultados de la segunda Jornada Pre 2012','<div>En la segunda jornada del Prenacional en Morelia estos fueron los resultados:</div><div><ul><li><font color=\"#0000ff\"><b>Fútbol varonil pierde frente a Jiquilpan por un marcador de 4 a 2</b></font></li><li><font color=\"#0000ff\"><b>Fútbol femenil empata a cero goles con su similar de Morelia</b></font></li><li><font color=\"#0000ff\"><b>Básquetbol pierde con Jiquilpan</b></font></li></ul><div>Para el dia mañana miércoles 25 se define la situación de fútbol varonil y femenil, lamentablemente dependemos de otros resultados para alcanzar el pase a la siguiente ronda.</div></div><div>Se pueden ver algunas fotos de la&nbsp;galería&nbsp;en el siguiente link:</div><div><a href=\"http://serviciosextraescolares.itsapatzingan.net/index.php?menu=galeria&amp;accion=general&amp;club=0&amp;album=2012042411111198\">http://serviciosextraescolares.itsapatzingan.net/index.php?menu=galeria&amp;accion=general&amp;club=0&amp;album=2012042411111198</a>\r\n</div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><a href=\"http://serviciosextraescolares.itsapatzingan.net/index.php?menu=galeria&amp;accion=general&amp;club=0&amp;album=2012042411111198\">http://serviciosextraescolares.itsapatzingan.net/index.php?menu=galeria&amp;accion=general&amp;club=0&amp;album=2012042411111198</a>','tm20120424234309888.JPG','2012-04-24','23:43:09',1),('4f9af37b5e6cb','Resultados Finales, Pre 2012 fut varonil','<font color=\"#0000ff\"><b>Lamentablemente nuestra selección no logra la victoria frente a La piedad en su último partido para poder colocarse en los cuatro primeros por un marcador de 5 a 2, por lo que que queda trabajar mas para poder lograr nuestros objetivos, de cualquier forma es importante reconocer el esfuerzo y la dedicación de cada uno de los participantes.</b></font>','tm201204271328585783.JPG','2012-04-27','13:28:59',1),('4f9af51b9819a','Semifinal Fut Femenil Pre 2012','<font color=\"#800080\"><b>Nuestras deportistas del balonpie logran colarse a semifinales enfrentándose al durísimo equipo de Los Linces de Celaya, que cabe mencionar son las campeonas nacionales; a pesar de tener un buen desempeño en la cancha en el segundo tiempo pierden 3 a 0 .&nbsp;</b></font><div><font color=\"#800080\"><b>Dejando&nbsp;así la posibilidad de pelear por el primer lugar y pasar &nbsp;al Nacional que se realizará este año en la Ciudad de León, Guanajuato en el mes de Septiembre</b></font></div>','tm201204271335553833.JPG','2012-04-27','13:35:55',1),('4f9af730b5540','Basquetbol Varonil, Pre 2012','<font color=\"#0000ff\">Básquetbol varonil pierde sus tres encuentros en la edición LVI del Evento Prenacional Deportivo.</font><div><font color=\"#0000ff\">Primeramente en el Auditorio Heber Soto del Tec de Morelia contra Zitácuaro, para el día martes frente a Jiquilpan y el miércoles frente a Celaya, ambos encuentros en el Auditorio de la Universidad Michoacana.</font></div><div><div><br></div></div>','tm201204271344483580.JPG','2012-04-27','13:44:48',1),('4fad765f4817f','Resumen del Prenacional del 08 al 11 mayo','Del 08 al 01 de Mayo del 2012 se participa en el LVI Evento Prenacional Deportivo en las disciplinas de Beisbol, Voleibol de Sala en sus dos ramas, así como en Voleibol de Playa.<div>Entre los tecnológicos participantes de la zona se encuentran Apatzingán, Celaya, Los Reyes, Uruapan, Puruandiro, Zámora, Zitácuaro, Morelia, Jiquilpan.</div><div>En Voleibol de sala rama varonil y femenil se disputó la final entre los equipos de Celaya y Morelia, ganándo Celaya en ambas ramas, en beisbol se corona Celaya y en <b><font color=\"#0000ff\">Voleibol de Playa Varonil el representativo del </font><font color=\"#ff0000\">Tec de Apatzingán</font><font color=\"#0000ff\"> gana su pase al LVI Evento Nacional Deportivo que se llevará a cabo a mediados del mes de Septiembre en la ciudad de León, Guanajuato.</font></b></div><div><font color=\"#0000ff\"><b><br></b></font></div><div><b>En el siguiente link encontraras algunas de las fotos de la delegación de Apatzingán</b></div><div><a href=\"http://serviciosextraescolares.itsapatzingan.net/index.php?menu=galeria&amp;accion=general&amp;club=0&amp;album=2012051102020774\">http://serviciosextraescolares.itsapatzingan.net/index.php?menu=galeria&amp;accion=general&amp;club=0&amp;album=2012051102020774</a>\r\n</div><div><font color=\"#0000ff\"><b><br></b></font></div><div><font color=\"#0000ff\"><b><br></b></font></div>','tm201205111428141441.JPG','2012-05-11','14:28:15',1),('4fb3d1194cdb0','Voleibol de Playa Varonil al NACIONAL 2012!!','<font color=\"#008000\"><b>Voleibol de Playa Varonil se corona Campeón del LVI Evento Prenacional Deportivo</b></font> que se llevó a cabo del 08 al 11 de Mayo en la Ciudad de Morelia al ganar sus cuatro encuentros, primeramente derrotando a Celaya en Tres Sets, a Uruapan y Zitacuaro en dos Sets y en el juego decisivo en dos a Morelia y así obtenienen su pase al Nacional que se realizará en la Ciudad de León, Guanajuato durante el mes de Septiembre del 2012.&nbsp;<div><div>Una sincera felicitación por el esfuerzo y trabajo realizado de parte del <b>Ing. José Luis Garibay Ibarra </b>a los alumnos<b> </b><font color=\"#0000ff\"><b>Ismael Estrada Jiménez</b></font> de Ingeniería Civil y <font color=\"#0000ff\"><b>Jorge Luis Aguilera Hernández</b></font> de Ingeniería Industrial.</div></div>		','tm20120516100856567.JPG','2012-05-16','23:35:55',1),('4fc455c89a70d','Resultados de la primer Jornada, Tlahuac','Nuestra delegación inicia actividades desde muy temprano en las disciplinas de Ajedrez,&nbsp;Natación&nbsp;&nbsp;y Atletismo; en la primer jornada se tienen buenos resultados en atletismo, ganando el pase por marca en la prueba de 100 metros planos Varonil por<font color=\"#0000ff\"><b>&nbsp;<span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:\" arial\",\"sans-serif\";mso-fareast-font-family:calibri;mso-ansi-language:=\"\" es-mx;mso-fareast-language:en-us;mso-bidi-language:ar-sa\"=\"\">Barragán Legorreta Alejandro y&nbsp;</span><span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:\" arial\",\"sans-serif\";mso-fareast-font-family:calibri;mso-ansi-language:=\"\" es-mx;mso-fareast-language:en-us;mso-bidi-language:ar-sa\"=\"\">Vazquez Torres Vi­ctor Manuel,</span></b></font>&nbsp;asi mismo se obtiene el primer y segundo lugar en la misma prueba en la rama femenil,<font color=\"#800080\"><b>&nbsp;<span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:\" arial\",\"sans-serif\";mso-fareast-font-family:calibri;mso-ansi-language:=\"\" es-mx;mso-fareast-language:en-us;mso-bidi-language:ar-sa\"=\"\">Meza Tijero Aidee y&nbsp;</span></b></font><span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:\" arial\",\"sans-serif\";mso-fareast-font-family:calibri;mso-ansi-language:=\"\" es-mx;mso-fareast-language:en-us;mso-bidi-language:ar-sa\"=\"\"><font color=\"#800080\"><b>Murillo Sosa Gladys\r\nFernanda</b></font> respectivamente.&nbsp;</span><div><font size=\"2\"><span style=\"line-height: 14px;\"><br></span></font><div><font face=\"Arial, sans-serif\" size=\"2\"><span style=\"line-height: 14px;\">Una sincera&nbsp;felicitación&nbsp;a todos los participantes.</span><br></font><div><font face=\"Arial, sans-serif\" size=\"2\"><span style=\"line-height: 14px;\"><br></span></font></div></div>	</div>	','tm201205282251191499.JPG','2012-05-28','22:58:53',1),('4fc598a9a1dc7','Segunda jornada, Prenacional Tlahuac ','Buenas noticias para nuestro Tec. se tiene la calificación y primer lugar en la prueba de 4 x 100 m planos femenil, y segundo lugar en la misma prueba en la rama varonil así mismo se obtiene primer lugar en lanzamiento de bala femenil, y el pase en los 800 m planos varonil, eso es en cuanto al atletismo, en la disciplina de&nbsp;natación también logra su pase al nacional en la prueba de 200 metro estilo pecho, por lo que el día de hoy se cosecharon tres medallas en el atletismo, dando un total de 5 hasta el momento. Para el día de mañana se tiene la&nbsp;participación&nbsp;de&nbsp;natación&nbsp;en la prueba de 100 m estilo pecho, y en atletismo 5000 m planos femenil y lanzamiento de bala varonil.<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<font color=\"#008000\"><b><span style=\"font-size: larger; \"> &nbsp; ¡¡¡FELICIDADES CUINIQUES!!!</span></b></font></div><div><font color=\"#008000\"><b><span style=\"font-size: larger; \">&nbsp;</span></b></font></div><div><a href=\"http://serviciosextraescolares.itsapatzingan.net/index.php?menu=galeria&amp;accion=general&amp;club=0&amp;album=2012052909521665\">http://serviciosextraescolares.itsapatzingan.net/index.php?menu=galeria&amp;accion=general&amp;club=0&amp;album=2012052909521665</a>&nbsp;</div>	','tm201205292148565891.JPG','2012-05-29','22:44:33',1),('4fe4cebf4b25c','¡¡¡Natacion al Nacional 2012!!','E<b>n el pasado Prenacional Deportivo que se llevó a cabo en la Ciudad de México,</b>\r\n<b>Distrito Federal&nbsp;</b>&nbsp;<b>&nbsp;del 27 al 31 de Mayo, se obtiene el <font color=\"#800080\">T<span style=\"font-size: larger; \">ercer Lugar</span></font> en Natación en la prueba de <font color=\"#008000\">100 metros estilo pecho</font> por el alumno <font color=\"#0000ff\">Jesús C. Toscano de&nbsp;Río </font>de la carrera de Ingeniería en Informática, una sincera felicitación por el esfuerzo y el trabajo desarrollado para poder llegar al Nacional, es importante mencionar que también calificó en la prueba de 200 metros del mismo estilo.</b><div><div style=\"text-align: center;\"><b><font color=\"#800080\"><span style=\"font-size: larger; \"></span><span style=\"font-size: larger; \"></span><span style=\"font-size: larger; \"><span style=\"font-size: larger; \">!!Vamos Sir. Kámaron!!!</span></span></font></b></div><div><br><div><br></div></div></div>		','tm20120622135958606.JPG','2012-06-22','14:07:24',1),('4fe4d8bcca7a4','Atletismo a León 2012','<font color=\"#0000ff\">El L.E.F <b>Vicente Cerna González</b> vuelve a demostrar su gran capacidad como entrenador en la disciplina de Atletismo al llevar de nuevo a su club al Nacional de Los Institutos Tecnológicos que se realizará en la Ciudad de León, Guanajuato, con una cantidad de 10 alumnos; en las pruebas de 100 metros planos varonil y femenil, relevo 4x100 metros planos varonil y femenil, 200 metros planos femenil, 800 metros planos varonil, lanzamiento de bala femenil.</font><div><font color=\"#0000ff\"><br></font></div><div><font color=\"#0000ff\"><br></font><div style=\"text-align: center;\"><font color=\"#0000ff\"><b>!!!FELICIDADES AL CLUB DE ATLETISMO DE NUEVA CUENTA!!</b></font></div></div>	','tm201206221442362232.jpg','2012-06-22','14:44:04',1);
